import PySimpleGUI as sg
import requests
import jsonpath
import pyperclip

indeximg = b''
url = "https://api.vc.bilibili.com/api/v1/drawImage/upload"
qrurl = "https://api.qrserver.com/v1/create-qr-code/?size=150150&data= "
img_url = ''

headers = {
    'User-Agent': "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/103.0.0.0 Safari/537.36"
}
headers.update({
    'Origin': "https://t.bilibili.com",
    'Referer': "https://t.bilibili.com/",
})
data = {
    'biz': "draw",
    'category': "daily",
}
with open('SESSDATA.txt', 'r') as fs:
    SESSDATA = fs.read()
fs.close()

sg.theme('BlueMono')  # 
# 
layout = [[sg.Text('', key='finalurl')],
          [sg.Image(indeximg, key='address'), sg.InputText('SESSDATA')],
          [sg.Button('SESSDATA'), sg.Button(''), sg.Button(''), sg.Button('')]]

# 
window = sg.Window('B()', layout)
# 
while True:
    event, values = window.read()
    if event in (None, ''):  # `Cancel`
        break
    if event == 'SESSDATA':
        SESSDATA = values[0]
        if values[0] == "SESSDATA":
            sg.Popup("bug")
            continue
        with open('SESSDATA.txt', 'w') as fs:
            fs.write(SESSDATA)
        fs.close()
        sg.popup(""+values[0])
    if event == '':
        imgadd = sg.popup_get_file('Browse')
        if imgadd is None:
            continue
        img = open(imgadd, 'rb')
        files = {
            'file_up': img,
        }
        cookies = {
            'SESSDATA': SESSDATA,
        }
        r = requests.post(url, data=data,
                          headers=headers,
                          cookies=cookies,
                          files=files, timeout=300
                          )
        j = r.json()
        img_url = jsonpath.jsonpath(j, '$.data.image_url')
        r.close()
        if img_url is False:
            sg.Popup("SESSDATA")
            continue
        qrcode = requests.get(qrurl+img_url[0])
        with open('test123.png', 'wb') as f:
            f.write(qrcode.content)
            f.close()
        qrcode.close()
        window['address'].update(filename='test123.png')
        window['finalurl'].update(img_url[0])
    if event == '':
        if img_url == '':
            continue
        pyperclip.copy(img_url[0])
        sg.Popup("")

window.close()
